// src/CustomCursor.ts
var CustomCursor = class extends Plugin {
  constructor() {
    super();
    this.pluginName = "Custom Cursor";
    this.author = "0rangeYouGlad";
    // Don't think it's feasible to use the copy alredy in the game files unfortunately, need a separate png
    this.images = [
      Legendary_scimitar_default,
      Celadon_scimitar_default,
      Coronium_scimitar_default,
      Palladium_scimitar_default,
      Steel_scimitar_default,
      Iron_scimitar_default,
      Bronze_scimitar_default,
      Damoguis_staff_default,
      Hydro_staff_default,
      Forest_staff_default,
      Ember_staff_default,
      Waters_Fury_default,
      Natures_Fury_default,
      Fires_Fury_default,
      Leaf_default,
      Golden_leaf_default,
      Chicken_39_default,
      Rooster_117_default,
      Raw_marlin_default,
      Marlin_default,
      Shovel_default,
      Chisel_default,
      Knife_default,
      Gnomes_hat_default,
      Bronze_longsword_default,
      Iron_longsword_default,
      Steel_longsword_default,
      Palladium_longsword_default,
      Coronium_longsword_default,
      Celadon_longsword_default,
      Legendary_longsword_default,
      nisse_small_default,
      Nisse_default
    ];
    this.settings.cursorOffset = {
      text: "Cursor Offset",
      type: SettingsTypes.text,
      value: "auto",
      callback: this.reset_cursor
    };
    this.settings.cursorImportant = {
      text: "Cursor Important (Hover and Click)",
      type: SettingsTypes.checkbox,
      value: true,
      callback: this.reset_cursor
    };
    this.settings.cursorImagePresets = {
      text: "Cursor Presets",
      type: SettingsTypes.range,
      value: 0,
      min: 0,
      max: this.images.length - 1,
      callback: this.reset_cursor
    };
    this.settings.cursorCustomImage = {
      text: "Cursor Custom Image",
      type: SettingsTypes.text,
      value: "",
      callback: this.reset_cursor
    };
  }
  get_png_from_preset() {
    if (this.images[this.settings.cursorImagePresets.value]) {
      return `${this.images[this.settings.cursorImagePresets.value]}`;
    }
    return this.images[0];
  }
  get_cursor_url() {
    return `url(${this.settings.cursorCustomImage.value || this.get_png_from_preset()})`;
  }
  init() {
    this.log("Initialized CustomCursor");
  }
  start() {
    this.log("Started CustomCursor");
    if (this.settings.enable.value) {
      this.set_cursor();
    }
  }
  stop() {
    this.log("Stopped CustomCursor");
    this.clear_cursor();
  }
  addCSSStyles(cursorName) {
    const preexistingStyle = document.head.querySelector("#cursorStyle");
    if (preexistingStyle) {
      document.head.removeChild(preexistingStyle);
    }
    if (cursorName) {
      const style = document.createElement("style");
      style.id = "cursorStyle";
      style.textContent = `
                .hs-screen-mask {
                    cursor: ${cursorName};
                }
                :hover {
                    cursor: ${cursorName};
                }
                html {
                    cursor: ${cursorName};
                }
            `;
      document.head.appendChild(style);
    }
  }
  set_cursor() {
    if (this.settings.enable.value) {
      this.addCSSStyles(`${this.get_cursor_url()}, ${this.settings.cursorOffset.value || "auto"} ${this.settings.cursorImportant.value ? "!important" : ""}`);
    }
  }
  reset_cursor() {
    this.clear_cursor();
    this.set_cursor();
  }
  clear_cursor() {
    this.addCSSStyles();
  }
};
export {
  CustomCursor as default
};
